export const deleteSlot = (slot, babysitter) => {
    debugger
    timeId = slot.time_of_day.map(t => t.id) 
    
    return dispatch => {
        return fetch(`http://localhost:3000/api/v1/babysitters/${babysitter.id}/slots/${slot.id}`, {
            method: 'DELETE'
        })
            .then(response => response.json())
            .then(babysitter => dispatch({ type: 'DELETE_SLOT', payload: babysitter }))



    }


}
